<?phpnamespace Nemundo\Content\App\Video\Content\YouTube;use Nemundo\Admin\Com\Video\AdminYouTubePlayer;use Nemundo\Com\Video\YouTube\YouTubePlayer;use Nemundo\Content\View\AbstractContentView;use Nemundo\Html\Block\Div;use Nemundo\Html\Paragraph\Paragraph;use Nemundo\Package\Bootstrap\Helper\Ratio\BootstrapAspectRatio;use Nemundo\Package\Bootstrap\Helper\Ratio\BootstrapRatioDiv;use Nemundo\Package\Bootstrap\Image\BootstrapResponsiveImage;class YouTubeView extends AbstractContentView{    /**     * @var YouTubeType     */    public $contentType;    public $viewName = 'Video';    protected function loadView()    {        $this->viewName = 'default';        $this->viewId = 'f4c68029-6d55-4bec-8352-6d11da635fae';        $this->defaultView = true;    }    public function getContent()    {        $youtubeRow = (new YouTubeItem($this->dataId))->getDataRow();  // $this->contentType->getDataRow();        /*$div = new Div($this);        $div->addCssClass('admin-embedded-video');*/        $player = new AdminYouTubePlayer($this);  // new YouTubePlayer($div);        $player->videoId = $youtubeRow->youtubeId;        $player->autoPlay = true;        $player->start=$youtubeRow->start;        $p=new Paragraph($this);        $p->content= $youtubeRow->description;        return parent::getContent();    }}